import { Header } from "components/header";
import MeetingRoom from "assets/images/carousel_image.jpg";

function Home() {
  return (
    <div className={homeStyles["home-container"]}>
      <Header />
      <IntroBlock />
      <CarouselBlock />
    </div>
  );
}

function IntroBlock() {
  return <div>W</div>;
}

function CarouselBlock() {
  return (
    <div>
      <img
        className={carouselStyles["carousel"]}
        src={MeetingRoom}
        alt="Meeting Room"
      />
    </div>
  );
}

export { Home };
